// images
import userAvatar from '../../../assets/images/users/avatar-7.jpg';

export interface UserInfoTypes {
    userName?: string;
    avatar?: string;
    designation?: string;
    location?: string;
    profileProgress: number;
    about?: string;
    email?: string;
    phone?: string;
    address?: string;
    skills?: string[];
}

const userInfo: UserInfoTypes = {
    userName: 'Grupo Gradín',
    location: 'San Francisco, CA',
    avatar: userAvatar,
    profileProgress: 60,
    about: "Grupo Gradín",
    email: 'grupogradin@grupogradin.com',
    phone: '(123) 123 1234',
};

export { userInfo };
